import React from 'react'
import styled from "styled-components"
import Announcement from '../components/Announcement'
import Navbar from '../components/Navbar'
import Newsletter from '../components/Newsletter'
import { mobile } from '../responsive'

const Container = styled.div`
`
const Wrapper = styled.div`
padding: 50px;
display: flex;
${mobile({padding:"10px", flexDirection: "column"})}
`
const ImgContainer = styled.div`
flex: 1;
`

const Image = styled.img`
width: 100%;
height: 90vh;
object-fit: cover;
${mobile({height: "40vh"})}
`

const InfoContainer = styled.div`
flex: 1;
padding: 0px 50px;
${mobile({padding: "10px"})}
`

const Title = styled.h1`
font-weight: 400;
`

const Desc = styled.p`
margin: 20px 0px;
`

const Price = styled.span`
font-weight: 350;
font-size: 40px;
`
const FilterContainer = styled.div`
width: 50%;
margin: 30px 0;
display: flex;
justify-content: space-between;
${mobile({width: "100%"})}
`
const Filter = styled.div`
display: flex;
align-item:center;
`
const FilterTitle = styled.span`
font-size: 20px;
font-weight: 200;
`
const FilterColor = styled.div`
width: 20px;
height: 20px;
border-radius: 50%;
align-items: center;
background-color: ${props=>props.color};
margin: 6px 5px;
cursor: pointer;
`

const FilterQuantity = styled.select`
margin-left: 10px;
padding: 5px;
`

const FilterQuantityOptions = styled.option`
`

const AddContainer = styled.div`
width: 50%;
display: flex;
align-items: center;
justify-content: space-between;
` 

/*const AmountContainer = styled.div`
display: flex;
align-items: center;
font-weight: 700;
` 

const Amount = styled.span`
width: 30px;
height: 30px;
border-radius: 10px;
border: 1px solid #1A6837;
display: flex;
align-items: center;
justify-content: center;
margin: 0px 5px;
` 
*/
const Button = styled.button`
padding: 15px;
border: none;
background-color: #1A6837;
color: white;
cursor: pointer;

&:hover{
    background-color: #81B175;
}
` 

const Product = () => {
  return (
    <Container>
        <Navbar/>
        <Announcement/>
        <Wrapper>
            <ImgContainer>
                <Image src="https://images.unsplash.com/photo-1571863393439-cf11e7d8a4b8?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=387&q=80"></Image>
            </ImgContainer>
            <InfoContainer>
                <Title>Verona Chair</Title>
                <Desc>The Verona chair features cushions of natural latex wrapped in luxurious organic wool batting. Certified organic fabrics include cotton duck, sturdy hemp, or a soft hemp-cotton blend. With its simple, modern styling, this natural armchair is suitable for nearly any room.</Desc>
                <Price>6599â‚¹</Price>
                <FilterContainer>
                    <Filter>
                        <FilterTitle>Color:</FilterTitle>
                        <FilterColor color="black"/>
                        <FilterColor color="darkblue"/>
                        <FilterColor color="gray"/>
                    </Filter>
                    <Filter>
                        <FilterTitle>
                            Quantity:
                        </FilterTitle>
                        <FilterQuantity>
                            <FilterQuantityOptions>
                                1
                            </FilterQuantityOptions>
                            <FilterQuantityOptions>
                                2
                            </FilterQuantityOptions>
                            <FilterQuantityOptions>
                                3
                            </FilterQuantityOptions>
                            <FilterQuantityOptions>
                                4
                            </FilterQuantityOptions>
                            <FilterQuantityOptions>
                                5
                            </FilterQuantityOptions>
                        </FilterQuantity>
                    </Filter>
                </FilterContainer>
                <AddContainer>
                    {
                    /*<AmountContainer>
                        <Remove/>
                        <Amount>1</Amount>
                        <Add/>
                    </AmountContainer>*/
                    }
                    <Button>Add to Cart</Button>
                </AddContainer>
            </InfoContainer>
        </Wrapper>
        <Newsletter/>
    </Container>
  )
}

export default Product
